import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click notifications button to open modal
    await page.waitForSelector('#notificationsBtn');
    await page.click('#notificationsBtn');
    await page.waitForTimeout(1000);

    // Wait for notifications modal to appear and take screenshot
    await page.waitForSelector('.notifications-modal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_notifications_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_notifications_modal.png'));

    // Extract all notification time elements
    const timeElements = await page.$$('.notification-time');
    const timestamps = [];

    // Process each time element
    for (const element of timeElements) {
      const timeText = await element.evaluate(el => el.textContent.trim());

      // Convert relative time to timestamp (assuming Korean format)
      let timestamp;
      if (timeText.includes('초 전')) {
        const seconds = parseInt(timeText);
        timestamp = new Date(Date.now() - seconds * 1000).toISOString();
      } else if (timeText.includes('분 전')) {
        const minutes = parseInt(timeText);
        timestamp = new Date(Date.now() - minutes * 60000).toISOString();
      } else if (timeText.includes('시간 전')) {
        const hours = parseInt(timeText);
        timestamp = new Date(Date.now() - hours * 3600000).toISOString();
      } else if (timeText.includes('일 전')) {
        const days = parseInt(timeText);
        timestamp = new Date(Date.now() - days * 86400000).toISOString();
      } else {
        // For absolute dates, keep as is
        timestamp = timeText;
      }

      timestamps.push(timestamp);
    }

    // Take final screenshot with notifications
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_notifications_with_times.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_notifications_with_times.png'));

    return {
      success: true,
      action: "Collected all notification time information and converted to timestamps",
      extractedData: {
        timestamps: timestamps,
        count: timestamps.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to collect notification time information",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

