import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click notifications button
    await page.waitForSelector('#notificationsBtn');
    await page.click('#notificationsBtn');
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_notifications_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_notifications_clicked.png'));

    // Wait for notification modal to appear and extract time data
    await page.waitForSelector('.notification-time', { timeout: 5000 });
    const timeData = await page.evaluate(() => {
      const timeElements = document.querySelectorAll('.notification-time');
      return Array.from(timeElements).map(el => el.textContent.trim());
    });

    // Convert time strings to timestamps
    const timestamps = timeData.map(timeStr => {
      // Parse relative time strings (e.g., "2 hours ago", "5 minutes ago")
      const now = new Date();
      if (timeStr.includes('hour')) {
        const hours = parseInt(timeStr);
        return new Date(now.getTime() - hours * 60 * 60 * 1000).toISOString();
      } else if (timeStr.includes('minute')) {
        const minutes = parseInt(timeStr);
        return new Date(now.getTime() - minutes * 60 * 1000).toISOString();
      } else if (timeStr.includes('day')) {
        const days = parseInt(timeStr);
        return new Date(now.getTime() - days * 24 * 60 * 60 * 1000).toISOString();
      }
      return timeStr; // Return original if format not recognized
    });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_notifications_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_notifications_loaded.png'));

    return {
      success: true,
      action: "Collected all notification time information and converted to timestamps",
      extractedData: {
        notificationTimes: timeData,
        timestamps: timestamps
      },
      screenshots,
      error: null
    };
  } catch (error) {
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    return {
      success: false,
      action: "Failed to collect notification time information",
      extractedData: {},
      screenshots: [...screenshots, path.join(screenshotsDir, 'error.png')],
      error: error.message
    };
  }
}
